  true,\n\t\"url\": null,\n\t\"notes\": \"Input data and heave results (unsteady RANS-VOF
  overset simulations performed in Star-CCM+) for a float with an ellipsoid geometry.
  Five extreme sea states were considered, as detailed in the conference paper \"Application
  of the Most Likely Extreme Response Method for Wave Energy Converters\" by Quon
  et al, in the proceedings of the 35th International Conference on Ocean, Offshore
  and Arctic Engineering (OMAE 2016). These sea states were extrapolated from conditions
  near Humboldt Bay, California. Focused waves were generated using the MLER module
  of the Wave Design Response Toolbox (WDRT) and specified at the inlet boundary conditions.
  The device was constrained to heave only and a PTO was not modeled. \",\n\t\"license_title\":
